function validateNumber(obj){
  if($(obj).val() != "" && $(obj).val() != null && typeof($(obj).val()) != "undefined"){
    var str = $(obj).val();
    str = str.replace(/[^0-9.]/g,'');
    if(str <= 0){
      $(obj).val(0.1);
    }else{
      $(obj).val(str);
    }
  }
}

